declare const _default: (val1: any, val2: any) => boolean;
/**
 * Determine whether or not two values are not equal (!=) weak checking.
 *
 * @example
 * // results in: false
 * hbs.compile("{{neqw a b}}")({"a":"3","b":3});
 *
 * @param {any} val1
 * @param {any} val2
 * @returns {boolean}
 */
export default _default;
